  (SART) activity provides support for the development of two databases to manage
  secondary and third-party data, data analysis, and reporting on results achieved
  by country and for the Agency as a whole. Specifically, this contract will (1) inform
  the target setting process at country level, (2) track, analyze, and report the
  results of USAID efforts under Goals 1 and 3 of the Education Strategy (2011-2015),
  and (3) make goal-related data available to USAID and its partners.\",\n\t\"license_title\":
